import './App.css';
import Navbar from './components/Navbar';
import TextForm from './components/TextForm';

let name = "Tajinder";

function App() {
  return (
    <>
    <Navbar title="Second title"/>
    <TextForm/>
    </>
  );
}

function Head(){
  return (
    <div className="container p-4">
      <h1>My Name is {name}</h1>
    </div>
  );
}

export default App;
